import { createUseStyles } from 'react-jss';
var useFontSizeStyles = createUseStyles({
    'xsmall': {
        fontSize: 11
    },
    'small': {
        fontSize: 12
    },
    'default': {
        fontSize: 14,
        lineHeight: 20,
    },
    'medium': {
        fontSize: 18,
        lineHeight: 25,
    },
    'large': {
        fontSize: 24
    },
    'xlarge': {
        fontSize: 32
    },
});
export { useFontSizeStyles };
